<html>
  <head>
   <title>Doctors Hospital Health</title>
   <link href="https://fonts.googleapis.com/css?family=Roboto:900" rel="stylesheet">
   <link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.8.1/css/all.css" integrity="sha384-50oBUHEmvpQ+1lW4y57PTFmhCaXp0ML5d60M1M7uH2+nqUivzIebhndOJK28anvf" crossorigin="anonymous">
   <script type="text/javascript" src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.3.1/jquery.min.js"></script>
   <script type="text/javascript">
   $(function(){
      $('#buttons li').click(function(e){
         $('iframe').attr('src',$(e.target).find('a').data('src'));
         $('#content').removeClass('hidden');
      });
      $('#close').click(function(e){
         $('body > *').hide();
         console.log('kiosk:reset'); // this will trigger the application reset
      });
   });
   </script>
   <style type="text/css">
   body{
   background: black;
   font-family: 'Roboto', sans-serif;
   }
   .hidden{
   display:none;
   visibility:hidden;
   }
   body, ul, li{
   margin:0;
   padding:0;
   list-style-type:'none';
   }
   #container{
   width: 1920px;
   height: 1000px;
   padding: 80px 0 0 0;
   background-color: #960630;
   background-repeat:no-repeat;
   background-position: 50% 35px;
   background-size:40%;
   }
   ul, li, li > a{
   display: block;
   }
   li{
   float: left;
   width: 360px; /* 1920px / 3 */
   height: 360px;
   margin: 100px 140px 0 140px;
   background: #f6f2e8;
   border-radius:240px;
   text-align:center;
   box-shadow: 5px 5px 20px rgba(0,0,0,0.35);
   cursor: pointer;
   }
   li > a{
   position: relative;
   top: 50%;
   transform: translateY(-50%);
   color: #fff;
   text-decoration:none;
   font-size: 30px;
   text-align:center;
   color: #333;
   padding: 60px;
   text-transform:uppercase;
   font-weight:900;
   pointer-events:none;
   }
   #content{
   position:absolute;
   background:black;
   top:0;
   left:0;
   height:1080px;
   width:1920px;
   z-index:1;
   }
   #content iframe{
   border:none;
   position:absolute;
   top:0;
   left:0;
   height:1080px;
   width:1920px;
   z-index:0;
   }
   #close{
   position:absolute;
   background: #000;
   top:40px;
   right:40px;
   display:block;
   z-index:1;
   padding:20px;
   border-radius: 20px;
   color: #fff;
   text-decoration:none;
   }
   #close i{
      transform: translateY(2px);
      font-size: 1.25em;
      margin-left: 0.25em;
   }
   </style>
